<script>
function sortTable(n) {
  const table = document.getElementById("referenceTable");
  let switching = true, dir = "asc", switchcount = 0;
  while (switching) {
    switching = false;
    const rows = table.rows;
    for (let i = 1; i < rows.length - 1; i++) {
      let x = rows[i].getElementsByTagName("TD")[n];
      let y = rows[i + 1].getElementsByTagName("TD")[n];
      let shouldSwitch = (dir === "asc") 
          ? x.innerText.toLowerCase() > y.innerText.toLowerCase()
          : x.innerText.toLowerCase() < y.innerText.toLowerCase();
      if (shouldSwitch) {
        rows[i].parentNode.insertBefore(rows[i + 1], rows[i]);
        switching = true;
        switchcount++;
        break;
      }
    }
    if (switchcount === 0 && dir === "asc") {
      dir = "desc"; switching = true;
    }
  }
}
</script>

<section style="padding: 20px; max-width: 800px; margin: 40px auto; font-size: 14px; background: #fff; border: 1px solid #ccc; border-radius: 6px;">
    <h2>Quick Reference Guide</h2>
    <p><strong>1. Arrays</strong>: Arrays in PHP are used to store multiple values in one variable. You define them with <code>array()</code> or <code>[]</code>. Example:</p>
    <pre><code>$fruits = array("apple", "banana", "cherry");
$fruits[] = "date";</code></pre>
    <p>You loop through them with <code>foreach</code>, or manipulate with functions like <code>array_merge</code>, <code>array_filter</code>, and <code>in_array</code>.</p>

    <p><strong>2. Objects</strong>: Objects are instances of classes. You define classes using <code>class</code> and instantiate with <code>new</code>. Example:</p>
    <pre><code>class Person {
    public $name;
    function __construct($name) {
        $this->name = $name;
    }
}
$me = new Person("Lenny");</code></pre>
    <p>Use <code>-></code> to access properties/methods, and follow OOP best practices for maintainability.</p>

    <p><strong>3. Variables</strong>: Variables are declared with <code>$</code> and can hold strings, numbers, arrays, objects, etc. Variable scope matters (local, global).</p>
    <pre><code>$name = "Lenny";
function greet() {
    global $name;
    echo "Hello, $name";
}</code></pre>

    <p><strong>Debugging Tips</strong>: Use <code>var_dump()</code>, <code>print_r()</code>, or <code>error_log()</code> for internal checks. Avoid exposing internals in production.</p>
</section>

